    cursor: pointer;

    display: flex;
    align-items:center;
    justify-content:center;

`
const AuthForm = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 400px;
    height: 500px;
    padding: 0 10px;
    background-color: white;
